from typing import List, Dict

class UserType(Enum):
    DATA_USER = 1
    UI_DESIGNER = 2
    DEVELOPER = 3
    AGENCY_USER = 4
    BROKER_USER = 5
    OWNER = 6
    FABS_USER = 7
    WEBSITE_USER = 8
    TESTER = 9

class SubmissionStatus(Enum):
    PENDING = 1
    SUBMITTED = 2
    PUBLISHED = 3
    REJECTED = 4

class ValidationError(Enum):
    INVALID_ZIP = 1
    INVALID_PPPOP_CODE = 2
    INVALID_DUNS = 3
    MISSING_REQUIRED_ELEMENT = 4

class ValidationRule:
    def __init__(self, name: str, description: str):
        self.name = name
        self.description = description

class Submission:
    def __init__(self, id: int, user_type: UserType, status: SubmissionStatus):
        self.id = id
        self.user_type = user_type
        self.status = status
        self.validation_errors = []

    def add_validation_error(self, error: ValidationError):
        self.validation_errors.append(error)

    def get_status_label(self) -> str:
        return self.status.name

class FABSSubmission(Submission):
